import React, { useContext, useState, useEffect } from "react";
import { BrowserRouter as Router, Routes, Route, Link, useNavigate } from "react-router-dom";
import { AuthProvider } from "./context/AuthContext";
import AuthContext from "./context/AuthContext";
import Welcome from "./pages/Welcome";
import PostList from "./components/PostList";
import Login from "./pages/Login";
import Register from "./pages/Register";
import "./App.css";

const Navbar = () => {
  const { user, logout } = useContext(AuthContext);
  const navigate = useNavigate();

  const handleLogout = () => {
    logout();
    navigate("/");
  };

  return (
    <nav className="navbar">
      <Link to="/">Home</Link> |{" "}
      {user ? (
        <>
          <Link to="/posts">Posts</Link> |{" "}
          <button onClick={handleLogout}>Logout</button>
        </>
      ) : (
        <>
          <Link to="/login">Login</Link> |{" "}
          <Link to="/register">Register</Link>
        </>
      )}
    </nav>
  );
};

// A new component to manage the responsive layout
const ResponsiveLayout = ({ children }) => {
  const [isMobile, setIsMobile] = useState(window.innerWidth < 768);

  useEffect(() => {
    const handleResize = () => setIsMobile(window.innerWidth < 768);
    window.addEventListener("resize", handleResize);
    return () => window.removeEventListener("resize", handleResize);
  }, []);

  return (
    <div className="responsive-layout">
      {!isMobile ? (
        <div className="desktop-layout">
          <div className="left-panel">
            {/* Replace the image source with your own image */}
            <img src="your-desktop-image.jpg" alt="Blog visual" className="blog-image" />
          </div>
          <div className="right-panel">
            {/* This is where the main content (e.g., PostList) goes */}
            {children}
          </div>
        </div>
      ) : (
        <div className="mobile-layout">{children}</div>
      )}
    </div>
  );
};

function App() {
  const { user } = useContext(AuthContext);

  return (
    <AuthProvider>
      <Router>
        <div className="container">
          <header className="header">
            <h1>Technology Blog</h1>
            <Navbar />
          </header>
          <Routes>
            <Route
              path="/"
              element={
                user ? (
                  <ResponsiveLayout>
                    <PostList />
                  </ResponsiveLayout>
                ) : (
                  <Welcome />
                )
              }
            />
            <Route path="/login" element={<Login />} />
            <Route path="/register" element={<Register />} />
            <Route
              path="/posts"
              element={
                <ResponsiveLayout>
                  <PostList />
                </ResponsiveLayout>
              }
            />
          </Routes>
        </div>
      </Router>
    </AuthProvider>
  );
}

export default App;
